import { Nav, Container, Row } from "react-bootstrap";

const Footer = () => {
  return (
    <div>
      <Container>
        <Row>
          <Nav>
            <Nav.Item>
              <Nav.Link href="">Twitter</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="">LinkedIn</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="">YouTube</Nav.Link>
            </Nav.Item>
          </Nav>
        </Row>
      </Container>
    </div>
  );
};

export default Footer;
